                combo = $('<select class="mtz-monthpicker mtz-monthpicker-year" />'),
                close = $('<button type="button" class="ui-datepicker-close" >닫기</button>'),
                selBtn = $('<div class="ui-datepicker-footer"><button type="button" class="btn-action c1">확인</button></div>'),
                table = $('<table class="mtz-monthpicker" />'),
                tbody = $('<tbody class="mtz-monthpicker" />'),
